--
-- Estructura de tabla para la tabla `ndb_dte_received`
--

CREATE TABLE `ndb_dte_received` (
  `dte_id` int(11) NOT NULL,
  `club_id` int(3) NOT NULL,
  `corp_id` varchar(20) CHARACTER SET latin1 NOT NULL,
  `corp_name` varchar(100) CHARACTER SET latin1 NOT NULL,
  `sender_id` varchar(20) CHARACTER SET latin1 NOT NULL,
  `sender_name` varchar(50) CHARACTER SET latin1 NOT NULL,
  `total` int(11) NOT NULL,
  `type` int(3) NOT NULL,
  `number` int(11) NOT NULL,
  `issued` date NOT NULL,
  `status` int(1) NOT NULL DEFAULT '-1',
  `status_sii` varchar(7) COLLATE utf8_spanish2_ci NOT NULL,
  `sii_date` datetime NOT NULL,
  `user_id` varchar(20) CHARACTER SET latin1 NOT NULL,
  `email` varchar(100) CHARACTER SET latin1 NOT NULL,
  `obs` varchar(100) CHARACTER SET latin1 NOT NULL,
  `xml` mediumtext CHARACTER SET latin1 NOT NULL,
  `exchange_id` int(11) NOT NULL,
  `hash` varchar(50) CHARACTER SET latin1 NOT NULL,
  `dte_data` text CHARACTER SET latin1 NOT NULL,
  `book_date` int(6) NOT NULL,
  `book_data` text CHARACTER SET latin1 NOT NULL,
  `attachment` varchar(50) COLLATE utf8_spanish2_ci NOT NULL,
  `on_update` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;

